import { Box, VStack, Text , FormControl, FormControlLabel, Input, InputField, FormControlLabelText} from '@gluestack-ui/themed';
import React, { useState, useEffect } from 'react';

const InserFoodGroups = () => {
    const [formData, setData] = useState({});
    return (
        
        <Box>
            <VStack>
                <Text>Create a Category </Text>
                <FormControl size={"md"} isDisabled={false} isRequired={false}>
                    <FormControlLabel>
                        <FormControlLabelText color="black" ml="$5" fontSize={"$sm"} fontWeight='$bold'>Name</FormControlLabelText>
                    </FormControlLabel>

                    <Input>
                        <InputField placeholder='Name' defaultValue='' type='text' onChangeText={value => setData({
                            ...formData,
                            Name: value
                        })} />
                    </Input>

                </FormControl>

            </VStack>
        </Box>
    );



}
export default InserFoodGroups;
